import { Link } from 'react-router-dom';

const NotAuthorizedPage = () => {
  return (
    <div>
      <h2>Yetkisiz Erişim</h2>
      <p>Bu sayfayı görüntüleme izniniz yok.</p>
      <Link to="/">Ana Sayfaya Dön</Link>
    </div>
  );
};

export default NotAuthorizedPage;
